from wikipedia:

&quot;A Toot and a Snore in '74 is a bootleg album of the only known recording session in which John Lennon and Paul McCartney played together after the break-up of The Beatles. Mentioned by Lennon in a 1975 interview, details were brought to light in May Pang's 1983 book, Loving John, and it gained wider prominence when McCartney made reference to the session in a 1997 interview. Discussing with Australian writer Sean Sennett in his Soho office, McCartney claimed the &quot;session was hazy... for a number of reasons&quot;. The story is corroborated by biographies such as Christopher Sandford's 2006 McCartney.&quot;

VERRRRRRRY hazy, but good for novelty's sake
